INSERT INTO `activity_team` (`idActivityTeam`, `idTeam`, `idTeacher`, `descriptionActivityTeam`, `fileName`, `path`, `fileType`, `fileSize`, `CreateDate`) VALUES
(29, 1, 1, '<p><a href=\"https://pt.wikipedia.org/wiki/The_Legend_of_Zelda:_Ocarina_of_Time\" rel=\"noopener noreferrer\" target=\"_blank\"><strong><em>The Legend of Zelda: Ocarina of Time</em></strong></a>&nbsp;é um&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Jogo_eletr%C3%B4nico_de_a%C3%A7%C3%A3o_e_aventura\" rel=\"noopener noreferrer\" target=\"_blank\">jogo eletrônico de ação e aventura</a>&nbsp;desenvolvido e publicado pela&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Nintendo\" rel=\"noopener noreferrer\" target=\"_blank\">Nintendo</a>&nbsp;para o&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Nintendo_64\" rel=\"noopener noreferrer\" target=\"_blank\">Nintendo 64</a>. Foi lançado no Japão e na América do Norte em novembro de 1998 e nas&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Regi%C3%A3o_PAL\" rel=\"noopener noreferrer\" target=\"_blank\">regiões PAL</a>&nbsp;no mês seguinte.&nbsp;<em>Ocarina of Time</em>&nbsp;é o primeiro jogo da série&nbsp;<a href=\"https://pt.wikipedia.org/wiki/The_Legend_of_Zelda\" rel=\"noopener noreferrer\" target=\"_blank\"><em>The Legend of Zelda</em></a>&nbsp;com&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Modelagem_tridimensional\" rel=\"noopener noreferrer\" target=\"_blank\">gráficos 3D</a>.</p><p>Foi desenvolvido pela&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Nintendo_Entertainment_Analysis_%26_Development\" rel=\"noopener noreferrer\" target=\"_blank\">Nintendo Entertainment Analysis &amp; Development</a>&nbsp;(EAD), liderada por cinco diretores, incluindo&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Eiji_Aonuma\" rel=\"noopener noreferrer\" target=\"_blank\">Eiji Aonuma</a>&nbsp;e&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Yoshiaki_Koizumi\" rel=\"noopener noreferrer\" target=\"_blank\">Yoshiaki Koizumi</a>, produzido pelo co-criador da série&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Shigeru_Miyamoto\" rel=\"noopener noreferrer\" target=\"_blank\">Shigeru Miyamoto</a>, e escrito por&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Kensuke_Tanabe\" rel=\"noopener noreferrer\" target=\"_blank\">Kensuke Tanabe</a>. O compositor veterano da série&nbsp;<em>Zelda</em>&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Koji_Kondo\" rel=\"noopener noreferrer\" target=\"_blank\">Koji Kondo</a>&nbsp;criou a trilha sonora. O jogador controla&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Link_(The_Legend_of_Zelda)\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a>&nbsp;na terra da fantasia de&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Hyrule\" rel=\"noopener noreferrer\" target=\"_blank\">Hyrule</a>&nbsp;em uma missão para parar o rei maligno&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Ganon\" rel=\"noopener noreferrer\" target=\"_blank\">Ganondorf</a>, viajando no tempo e navegando em masmorras e um&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Overworld\" rel=\"noopener noreferrer\" target=\"_blank\"><em>overworld</em></a>. O jogo introduziu recursos como um sistema de bloqueio de alvo e botões sensíveis ao contexto que se tornaram comuns em jogos de aventura em 3D. O jogador deve aprender a tocar várias músicas em uma&nbsp;<a href=\"https://pt.wikipedia.org/wiki/Ocarina\" rel=\"noopener noreferrer\" target=\"_blank\">ocarina</a>&nbsp;para progredir.&nbsp;<strong>(</strong><a href=\"https://pt.wikipedia.org/wiki/The_Legend_of_Zelda:_Ocarina_of_Time\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>Leia mais</strong></a><strong>)</strong></p>', 'Cyberpunk-2077 (3).torrent', 'C:\\TeamTeach\\WebSite\\backend\\uploads\\Cyberpunk-2077 (3).torrent', '.torrent', 390986, '2024-05-19 10:15:24'),
(30, 1, 1, '<p>	Quiénes somos</p><p>IONOS es el proveedor preferido de las pymes cuando se trata de soluciones de hosting e infraestructuras cloud. No solo ofrecemos una cartera de productos y servicios que permiten a las empresas iniciar y hacer crecer su negocio en Internet, sino también nuestra experiencia en infraestructuras (IaaS). Contamos con 6 millones de clientes y alojamos 22 millones de nombres de dominio en nuestros centros de datos ubicados en todo el mundo.</p><p>Ofrecemos nuestros servicios a autónomos que dan sus primeros pasos online, a dueños de negocios crecientes, a grandes empresas y a socios que les estén ayudando a alcanzar sus metas. No importa si estás construyendo tu presencia online comprando un dominio, si estás creando tu página web, trasladando procesos de back-office a la cloud u organizando un cluster de contenedores, nuestro portafolio de productos te ofrece aplicaciones, servidores y servicios de primera.</p><p>Nuestros productos están diseñados para aportarte confianza y seguridad. La red de centros de datos que hemos creado proporcionan el mejor rendimiento y georredundancia. En IONOS nos enorgullecemos de la tradición en tecnología puntera, la política de privacidad sólida y una seguridad de datos integral.</p><p>Nuestros clientes son lo primero. Por eso ahora además de tener a tu disposición equipos de asistencia locales para ayudarte en cualquier momento, ahora somos el primer proveedor a nivel mundial que te ofrece un asistente personal que brinda asesoramiento experto a medida de tus necesidades.</p>', NULL, NULL, NULL, NULL, '2024-05-29 09:13:14');

